	{
	quote: 'The way to get started is to quite and begin doing.',
	author: '-Walt Disney'
	},
	{
	quote: 'The pessimist sees difficulty in every opportunity. The optimist sees the opportunity in every difficulty.',
	author: '-Winston Churchill'
	},
	{
	quote: 'Don\'t let yesterday take up too much of today.',
	author: '-Will Rogers'
	},
	{
	quote: 'It\'s not whether you get knocked down, it\'s whether you get up.',
	author: '-Vince Lombardi'
	},
	{
	quote: 'If you are working on something exciting that you really care about, you don\'t have to be pushed. The vision pulls you.',
	author: '-Steve Jobs'
